import Welcome from "./Wellcome";

function Test(props) {
  return <>Test {props.t} </>;
}

export default [
  {
    path: "/",
    name: "Home",
    component: <Welcome />,
  },
  {
    path: "/students",
    name: "Students",
    component: <Test t="Students" />,
  },
  {
    path: "/professors",
    name: "Professors",
    component: <Test t="Professors" />,
  },
  {
    path: "/courses",
    name: "Courses",
    component: <Test t="Courses" />,
  },
  {
    path: "/exams",
    name: "Exams",
    component: <Test t="Exams" />,
  },
];
